import { Component } from 'react';
import './estilos_registro_empresa.css';


class Registro_Empresa extends Component{
    constructor(){
        super()
        this.state={
            showMe:true
        }
    }

    render(){
        return(
            <div className="contenedor-empresa" id="mostrar-registro-empresa">
                {this.state}
            </div>
        );
    }
}

export default Registro_Empresa;
